import { NavLink } from "react-router-dom";
import { UidContext } from "./AppContext";
import React, { useContext } from 'react';

const Navbar = () => {
    const uid = useContext( UidContext );
    return (
        <div>
            {uid ? (
                <ul>
                    <li>

                    </li>
                </ul>
            ):
            ( <li>

            </li>
            )}
        </div>
    );
};

export default Navbar;
